import React from 'react';
import Listing from '../components/listing';

const listings = props => {
  const listings = props.data.map(l_data => (
    <div className='col-1-of-3'>
      {' '}
      <Listing data={l_data} />{' '}
    </div>
  ));

  return (
    <div>
      <div className='row'>{listings}</div>
    </div>
  );
};

export default listings;
